import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const HomeSupply = () => {
  return (
    <View>
      <Text>HomeSupply</Text>
    </View>
  )
}

export default HomeSupply

const styles = StyleSheet.create({})
